import {
  BrowserRouter,
  Navigate,
  Route,
  Routes,
  useNavigate,
} from "react-router-dom";
import HomePage from "./homePage/HomePage";
import Login from "./login/Login";

function App() {
  const token: any = localStorage.getItem("access_token");
  const checkToken = (token: any) => {
    return <Navigate to="/HomePage" Component={HomePage} /> ? (
      token
    ) : (
      <Navigate to="/login" />
    );
  };

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" Component={Login} />
        <Route path="/HomePage" element={checkToken(token)} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
